  return (
    <div style={{ width: "100%", textAlign: "center", marginTop: "5rem" }}>
      <h1>Our Employee</h1>
      <User name="Max" age="34" />
      <User name="Sam" age="28">
        My Favorite Things: Swiming, Racing
      </User>
      <User name="Joshua" age="21" />
    </div>
  );
}

export default App;
